INSERT INTO `video_food_info` VALUES (1, 'https://www.bilibili.com/video/BV18W4y1672f', 'http://i2.hdslb.com/bfs/archive/8364638288de898c8af5e52641d299d1c876e1d4.jpg', '我真服了这老六！这玩意敢卖10块一桶？血亏。。。', '时令美味上饿了么 小龙虾 家常菜 美食 美食 美食制作 料理制作 生活 日常 料理 拉面 养小龙虾 ', '2022-06-20 18:26:36', '麟宣森', '-', 195394, 0, 0, 2654);
INSERT INTO `video_food_info` VALUES (2, 'https://www.bilibili.com/video/BV1994y1y79o', 'http://i2.hdslb.com/bfs/archive/0ea583b950a9130c0b7ca82f23f75d21dfc2aa7a.jpg', '从火腿上切下来的猪油，西班牙人居然直接丢掉！我实在看不下去了', '种草大作战 吃货 美食 美食 美食制作 外国人 猪油 火腿 打卡挑战 ', '2022-06-22 20:26:19', '西班牙陈挺', '-', 131559, 480, 6253, 131);
INSERT INTO `video_food_info` VALUES (3, 'https://www.bilibili.com/video/BV1rZ4y1v7ta', 'http://i0.hdslb.com/bfs/archive/9b03a3fa1f662ec2027e9df550f9176c25b9c2d2.jpg', '西藏特有的鸡汤？单单成本就要800元，靓仔惊呼没吃过这么特别的鸡肉', '地方特色美食菜谱大探索 美食 搞笑 美食 美食侦探 藏香鸡 鸡汤 采蘑菇 石锅鸡 羊肚菌 西藏美食 墨脱石锅 我的宝藏做饭指南 ', '2022-06-22 18:05:00', '探索吧芋圆', '跟上期视频一起看，烤藏香猪第二集，不然看不太懂', 75746, 0, 8552, 1047);
INSERT INTO `video_food_info` VALUES (4, 'https://www.bilibili.com/video/BV1sr4y1G7JJ', 'http://i2.hdslb.com/bfs/archive/ba446eb92aadad4c916f57143e71b5ab7d7f594b.jpg', '天气热了，给大家做杯酸梅汤吧，注意防暑。', '美食 美食 美食记录 夏天 美食vlog 饮品 养生 打卡挑战 ', '2022-06-21 21:30:56', '侯小鑫の生活速写', '', 52827, 3205, 0, 953);
INSERT INTO `video_food_info` VALUES (5, 'https://www.bilibili.com/video/BV133411u7Zg', 'http://i0.hdslb.com/bfs/archive/48aa026159732b631e62ca4d2d21f8d6f567c7aa.jpg', '200元寿喜锅自助，和牛澳龙随便造？老板到底咋回本啊？【怎么这么值ep41-牛new】', '美食侦探征集令 美食侦探 探店 美食 美食 美食侦探 自助餐 寿喜烧 和牛 寿喜锅 美食VLOG 畅吃 ', '2022-06-22 11:05:00', '王师傅和小毛毛', '怒开30公里，3个月来首次堂食！眼含热泪连吃10碟和牛！太鼎了！', 80327, 0, 7476, 7800);
INSERT INTO `video_food_info` VALUES (6, 'https://www.bilibili.com/video/BV1PY4y137at', 'http://i2.hdslb.com/bfs/archive/9d4882674d5f5e488757f10615f40b67a9d32a5e.jpg', '美国开售人造鸡蛋和人造牛奶！做成蛋挞能好吃吗？', '试吃 歪果仁 美国 美食 美食 美食测评 吃播 评测 老外 人造鸡蛋 ', '2022-06-22 11:30:00', '我是郭杰瑞', '', 94626, 0, 3535, 1545);
INSERT INTO `video_food_info` VALUES (7, 'https://www.bilibili.com/video/BV1Hg411X7ZU', 'http://i1.hdslb.com/bfs/archive/4b36479b998e5c371eb0ff01d7a626a6033c6dca.jpg', '柳州小巷“炸了20多年的老炸鸡”，一口下去好酥脆', '炸鸡腿 炸鸡 街头美食 美食 美食 美食侦探 街头小吃 路边摊 广西美食 特色美食 地方美食 柳州美食 柳州小吃 ', '2022-06-22 18:50:06', '肉肉大搜索', '柳州小巷“炸了20多年的老炸鸡”，一口下去好酥脆', 75827, 0, 7382, 0);
INSERT INTO `video_food_info` VALUES (8, 'https://www.bilibili.com/video/BV1nS4y1v7Vh', 'http://i0.hdslb.com/bfs/archive/c2c640f4ef72a4305f4bbaf3e6412a89f179e82f.jpg', '【日食记】夏至日整大活了！冰粉用盆装，龙虾吃到撑', '小龙虾 吃货 美食 美食 美食制作 日食记 美食vlog 冰粉 夏至 ', '2022-06-21 18:30:00', 'null', 'null', 74982, 0, 8027, 7974);
