INSERT INTO `video_music_info` VALUES (3, 'https://www.bilibili.com/video/BV1MZ4y1i7aY', 'http://i0.hdslb.com/bfs/archive/dc2c806c6a655ee8f47dd9855c1d87b5c7daf6e9.jpg', '哔哩哔哩2022毕业歌《光阴的故事2022》| 罗大佑×易烊千玺', '易烊千玺 毕业季 原创歌曲 音乐 原创音乐 光阴的故事 青春 毕业 单曲 罗大佑 ', '2022-06-21 12:41:47', '哔哩哔哩弹幕网', '2022年的毕业季，和以往都不太一样。\n第一届00后走向社会，等待他们的，是前所未有的机遇和挑战。\n今年的B站毕业歌，我们重新演绎了《光阴的故事》，由原作者罗大佑制作，今年的毕业生易烊千玺献唱。希望这', 115245, 0, 0, 0);
